    if(req.query.humidInner){
        fs.writeFile('./data/humidInner.txt', req.query.humidInner, (err , data) =>  {
            if(err){
                throw err;
            }
        });
    }

    //pm10
    if(req.query.pm10Outer){
        fs.writeFile('./data/pm10Outer.txt', req.query.pm10Outer, (err , data) =>  {
            if(err){
                throw err;
            }
        });
